&lt;li&gt;Cuenta con 3 puntos de soporte.&lt;/li&gt;
&lt;li&gt;Se mantiene de pie sin necesidad de detenerlo.&lt;/li&gt;
&lt;li&gt;F&aacute;cil de guardar y transportar.&lt;/li&gt;
&lt;li&gt;Sistema Antishock.&lt;/li&gt;
&lt;li&gt;Ligero.&lt;/li&gt;
&lt;li&gt;Utiliza 4 Bater&iacute;as no incluidas.&lt;/li&gt;
